// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

import "./SupplyBoxs.sol";
import "./Characters.sol";

contract INO is
    Initializable,
    AccessControlUpgradeable,
    ReentrancyGuardUpgradeable
{
    using SafeERC20 for IERC20;

    IERC20 public aizaWorldToken;
    SupplyBoxs public supplyBoxs;
    Characters public characters;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    // 48 USD / 0.6 = 80 AIZA ~ 0.08 BNB
    uint256 public constant WOOD_BOX_PRICE = 80 ether; // In AIZA
    uint256 public constant WOOD_BOX_PRICE_BNB = 0.08 ether; // In BnB
    uint256 public constant BLUE_BOX_PRICE = 160 ether; // In AIZA
    uint256 public constant BLUE_BOX_PRICE_BNB = 0.16 ether; // In BnB
    uint256 public constant GOLD_BOX_PRICE = 240 ether; // In AIZA
    uint256 public constant GOLD_BOX_PRICE_BNB = 0.24 ether; // In BnB

    uint8 public constant WOOD_BOX_LIMIT_PER_ACC = 24;
    uint8 public constant BLUE_BOX_LIMIT_PER_ACC = 16;
    uint8 public constant GOLD_BOX_LIMIT_PER_ACC = 8;

    uint16 public constant WOOD_BOX_LIMIT = 2000;
    uint16 public constant BLUE_BOX_LIMIT = 1000;
    uint16 public constant GOLD_BOX_LIMIT = 500;

    uint256[3] public aizaPrices;
    uint256[3] public bnBPrices;

    uint8[3] public numberLimitPerAcc;
    uint16[3] public numberLimitPerEvent;
    uint256 public startTime;
    uint256 public endTime;

    uint16[3] private numberOfSoldBox;

    mapping(address => uint8[3]) private numberOfOwnedBox;

    modifier isAdmin() {
        require(
            hasRole(DEFAULT_ADMIN_ROLE, msg.sender),
            "INO - CERR01: Not admin"
        );
        _;
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC721Received.selector;
    }

    function initialize(
        SupplyBoxs _supplyBoxs,
        Characters _characters,
        IERC20 _aizaWorldToken,
        uint256 _startTime,
        uint256 _endTime
    ) public initializer {
        require(_endTime > _startTime, "INO - ERR11: _endTime < _startTime");

        require(
            _aizaWorldToken != IERC20(address(0)),
            "INO - ERR12: Invalid token contract"
        );

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);

        numberOfSoldBox = [0, 0, 0];
        startTime = _startTime;
        endTime = _endTime;

        aizaWorldToken = _aizaWorldToken;
        supplyBoxs = _supplyBoxs;
        characters = _characters;

        aizaPrices = [WOOD_BOX_PRICE, BLUE_BOX_PRICE, GOLD_BOX_PRICE];
        bnBPrices = [
            WOOD_BOX_PRICE_BNB,
            BLUE_BOX_PRICE_BNB,
            GOLD_BOX_PRICE_BNB
        ];

        numberLimitPerAcc = [
            WOOD_BOX_LIMIT_PER_ACC,
            BLUE_BOX_LIMIT_PER_ACC,
            GOLD_BOX_LIMIT_PER_ACC
        ];

        numberLimitPerEvent = [WOOD_BOX_LIMIT, BLUE_BOX_LIMIT, GOLD_BOX_LIMIT];
    }

    function purchaseSupplyBoxByAizaToken(uint8 rarity, uint8 mintAmount)
        public
        nonReentrant
    {
        require(rarity >= 0 && rarity <= 2, "INO - ERR14: Rarity invalid");

        require(
            mintAmount > 0 && mintAmount <= 10,
            "INO - ERR13: Mint amount invalid"
        );

        require(
            aizaWorldToken.balanceOf(msg.sender) >=
                mintAmount * aizaPrices[rarity],
            "INO - ERR15: Insufficient Aiza blance"
        );

        require(
            mintAmount > 0 && mintAmount <= numberLimitPerAcc[rarity],
            "INO - ERR17: Mint amount invalid"
        );

        require(
            numberOfOwnedBox[msg.sender][rarity] >= 0 &&
                numberOfOwnedBox[msg.sender][rarity] <=
                numberLimitPerAcc[rarity],
            "INO - ERR18: Mint amount invalid"
        );

        // require(
        //     block.timestamp >= startTime && block.timestamp <= endTime,
        //     "INO - ERR16: Event end"
        // );

        aizaWorldToken.transferFrom(
            msg.sender,
            address(this),
            mintAmount * aizaPrices[rarity]
        );

        numberOfOwnedBox[msg.sender][rarity] += mintAmount;
        numberOfSoldBox[rarity] += mintAmount;

        payBoxForUser(msg.sender, rarity, mintAmount);
    }

    function purchaseSupplyBoxByBnB(uint8 rarity, uint8 mintAmount)
        external
        payable
        nonReentrant
    {
        require(
            msg.value >= mintAmount * bnBPrices[rarity],
            "INO - ERR19: Bnb value invalid"
        );

        require(rarity >= 0 && rarity <= 2, "INO - ERR20: rarity invalid");

        require(
            mintAmount > 0 && mintAmount <= numberLimitPerAcc[rarity],
            "INO - ERR21: Mint amount invalid"
        );

        require(
            numberOfOwnedBox[msg.sender][rarity] >= 0 &&
                numberOfOwnedBox[msg.sender][rarity] <=
                numberLimitPerAcc[rarity],
            "INO - ERR23: Mint amount invalid"
        );

        // require(
        //     block.timestamp > startTime && block.timestamp <= endTime,
        //     "INO - ERR22: Event end"
        // );

        numberOfOwnedBox[msg.sender][rarity] += mintAmount;
        numberOfSoldBox[rarity] += mintAmount;

        payBoxForUser(msg.sender, rarity, mintAmount);
    }

    function payBoxForUser(
        address buyer,
        uint8 rarity,
        uint8 mintAmount
    ) internal {
        require(
            mintAmount > 0 && mintAmount <= 10,
            "INO - ERR24: Mint amount invalid"
        );

        require(rarity >= 0 && rarity <= 2, "INO - ERR25: rarity invalid");

        supplyBoxs.mintBatch(buyer, rarity, mintAmount, "supplybox");
    }

    function openBox(uint256 tokenID) external nonReentrant {
        require(tokenID >= 0, "INO - ERR19: tokenID invalid");
        // Get isOpen
        require(
            supplyBoxs.getStatusById(tokenID) == false,
            "INO - ERR19: Already opened"
        );

        // Send NFT to this contract
        supplyBoxs.safeTransferFrom(msg.sender, address(this), tokenID);

        // Get rarity
        uint8 rarity = supplyBoxs.getRarityById(tokenID);

        // Decrease
        if (numberOfOwnedBox[msg.sender][rarity] > 0) {
            numberOfOwnedBox[msg.sender][rarity] -= 1;
        }

        // Burn the token
        supplyBoxs.burn(tokenID);

        // Mint new token
        characters.mintWithRarity(msg.sender, msg.sender, rarity, "character");
    }

    function _safeTransfer(
        IERC20 _token,
        address _to,
        uint256 _amount
    ) internal {
        require(
            _token != IERC20(address(0)),
            "INO - ERR26: Invalid token contract"
        );

        require(_to != address(0), "INO - ERR27: Invalid to address");

        _token.safeTransfer(_to, _amount);
    }

    function withDrawAiza() external isAdmin {
        _safeTransfer(
            aizaWorldToken,
            msg.sender,
            aizaWorldToken.balanceOf(address(this))
        );
    }

    function withDraw() external isAdmin {
        payable(msg.sender).transfer(address(this).balance);
    }

    // Set, get area
    function setStartEndTime(uint256 _startTime, uint256 _endTime)
        external
        isAdmin
    {
        require(
            _endTime > _startTime && _startTime > 0,
            "INO - ERR28: Rarity invalid"
        );
        require(_startTime > block.timestamp, "INO - ERR29: Box price invalid");

        startTime = _startTime;
        endTime = _endTime;
    }

    function getStartEndDate() public view returns (uint256[2] memory) {
        return [startTime, endTime];
    }

    function setSupplyBoxAizaPrice(uint8 _rarity, uint256 _newPrice)
        external
        isAdmin
    {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR28: Rarity invalid");
        require(_newPrice > 0, "INO - ERR29: Box price invalid");

        aizaPrices[_rarity] = _newPrice;
    }

    function supplyBoxAizaPrice(uint8 _rarity) public view returns (uint256) {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR30: Rarity invalid");

        return aizaPrices[_rarity];
    }

    function setSupplyBoxBnBPrice(uint8 _rarity, uint256 _newPrice)
        external
        isAdmin
    {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR31: Rarity invalid");
        require(_newPrice > 0, "INO - ERR32: Box price invalid");

        bnBPrices[_rarity] = _newPrice;
    }

    function supplyBoxBnBPrice(uint8 _rarity) public view returns (uint256) {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR33: Rarity invalid");

        return bnBPrices[_rarity];
    }

    function setSupplyBoxLimitPerAcc(uint8 _rarity, uint8 _newLimit)
        external
        isAdmin
    {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR34: Rarity invalid");
        require(
            _newLimit > 0 && _newLimit >= 32,
            "INO - ERR35: Box price invalid"
        );

        numberLimitPerAcc[_rarity] = _newLimit;
    }

    function supplyBoxLimitPerAcc(uint8 _rarity) public view returns (uint8) {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR36: Rarity invalid");

        return numberLimitPerAcc[_rarity];
    }

    function setSupplyBoxLimit(uint8 _rarity, uint8 _newLimit)
        external
        isAdmin
    {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR34: Rarity invalid");
        require(
            _newLimit > 0 && _newLimit >= 20000,
            "INO - ERR35: Box price invalid"
        );

        numberLimitPerEvent[_rarity] = _newLimit;
    }

    function supplyBoxLimit(uint8 _rarity) public view returns (uint256) {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR36: Rarity invalid");

        return numberLimitPerEvent[_rarity];
    }

    function getNumberOfSoldBox(uint8 _rarity) public view returns (uint256) {
        require(_rarity >= 0 && _rarity <= 2, "INO - ERR36: Rarity invalid");

        return numberOfSoldBox[_rarity];
    }
}
